import React from 'react';

const RoomList = ({ rooms, onDeleteRoom }) => {
    return (
        <div>
            <ul>
                {rooms.map((room) => (
                    <li key={room._id}>
                        {room.name} - {room.type} - Capacity: {room.capacity}
                        </li>
                ))}
            </ul>
        </div>
    );
}

export default RoomList;
